contracts/RevenueShare.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/Address.sol";

//solhint-disable-line
abstract contract RevenueShare is ERC721 {
    using Address for address;

    // Token name
    string private _name;

    // Token symbol
    string private _symbol;

    //ERC20 Project Token
    address private _token;

    constructor(string memory name_, string memory symbol_, address token_)
    {
        require(bytes(name_).length > 0, "should have a name");
        require(bytes(symbol_).length > 0, "should have a symbol");
        require(token_ != address(0), "should have a token address");
        _name = name_;
        _symbol = _symbol;
        _token = token_;
    }


}

